import React from 'react';
import Box from '@material-ui/core/Box';

const SlideWindow = ({ data }) => {
    return (
        <Box
            style={{
                width: '200px',
                height: '200px',
                marginTop: '190px',
                marginLeft: '300px',
                alignSelf: 'center'
            }}
        >
            <p> Slide Info:</p>
            <ul>
                {data.map((string, index) => (
                <li key={index}>{string}</li>
                ))}
            </ul>
        </Box>
    );
};

export default SlideWindow;
